import React from 'react';
import '../index.css';

function Navbar() {
  return (
    <div>
      <section class="colored-section navbar-section">
        <nav>
          <a href="#">Home</a>
          <a href="#">Event</a>
          <a href="#">Sponsors</a>
          <a href="#">Schedule</a>
          <a href="#">FAQ</a>
        </nav>
      </section>
    </div>
  );
}

export default Navbar;
